import React, { Component } from 'react';

const educations = [
  {
    school: 'Institut Universitaire de la C么te',
    degree: 'Bachelor in Software Engineering',
    subject: 'Computer Science - Web Development Track',
    dates: 'September 2015 - November 2016'
  },
  {
    school: 'Institut Universitaire de la C么te/ CCNB',
    degree: 'Diplome dEtudes Collegiale',
    subject: 'Information and Communication Technology',
    dates: 'October 2013 - July 2015'
  },
  {
    school: 'Saint Francis College',
    degree: 'G.C.E Advanced Levels',
    subject: 'A1',
    dates: 'September 2009 - June 2010'
  }
]




const Ed = () => {
return (
  <div class="resume-item d-flex flex-column flex-md-row justify-content-between mb-5">
  <div class="resume-content">
    <h3 class="mb-0">University of Colorado Boulder</h3>
    <div class="subheading mb-3">Bachelor of Science</div>
    <div>Computer Science - Web Development Track</div>
  </div>
  <div class="resume-date text-md-right">
    <span class="text-primary">August 2006 - May 2010</span>
  </div>
</div>
)
}

export default class Education extends Component {
  render() {
    return (<section class="resume-section p-3 p-lg-5 d-flex align-items-center" id="education">
      <div class="w-100">
      
      <Ed />
       
 
      </div>
    </section>)
  }
}
